import React from 'react'
import {Avatar, Card} from 'antd'

const UserProfile = () =>{
    return (
        <Card>
            <Card.Meta
                title = "jihan"
                avatar = {<Avatar>JH</Avatar>}
            />
        </Card>
    )
}

export default UserProfile;
